  return (
      <AppShell
        padding="md"
        navbar={
          <Navbar width={{ base: 300 }} height={500} p="xs">
            {/* Navbar content */}
          </Navbar>
        }
        header={
          <Header height={60} p="xs">
            <Title>Kanji</Title>
          </Header>
        }

        styles={(theme) => ({
          main: { backgroundColor: theme.colorScheme === 'dark' ? theme.colors.dark[8] : theme.colors.gray[0] },
        })}
      >
      <ProgressCircle
        initialAngularDisplacement={0}
        selectedValue={75}
        maxValue={100}
        radius={100}
        activeStrokeColor='#0f4fff'
        withGradient
      />

      </AppShell>
    );

}

export default Home
